"use strict";window.utils={ENTER_KEYCODE:13,ESC_KEYCODE:27,generateIntegerNumber:function(n,e){return Math.floor((e-n+1)*Math.random())+n},isEnterEvent:function(n,e){13===n.keyCode&&e()},isEscEvent:function(n,e){27===n.keyCode&&e()},hiddenElement:function(n){n.classList.contains("hidden")||n.classList.add("hidden")},showElement:function(n){n.classList.contains("hidden")&&n.classList.remove("hidden")}};